import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Create from './views/partials/header';
import Edit from './views/partials/edit-player';
import Add from './views/partials/add-player'
import Home from './views/index';


class App extends Component {
 render() {
    return (
        <Router>
            <div className="container">
                <nav className="navbar navbar-expand-lg navbar-light bg-light">
                    <Link to={'/'} className="navbar-brand">SERN CRUD Example</Link>
                    <div className="collapse navbar-collapse"      id="navbarSupportedContent">
                        <ul className="navbar-nav mr-auto">
                            <li className="nav-item">
                                <Link to={'/index'} className="nav-link">Home</Link>
                            </li>
                            <li className="nav-item">
                                <Link to={'/create'} className="nav-link">Create</Link>
                            </li>
                            <li className="nav-item">
                                <Link to={'/add'} className="nav-link">Add-Player</Link>
                            </li>
                            <li className="nav-item">
                                <Link to={'/edit'} className="nav-link">Edit-Player</Link>
                            </li>
                        </ul>
                    </div>
                    {/* nav-bar collapse */}
                </nav><br/>
                <h2>Welcome to  SOCKA</h2><br/>
                <Switch>
                    <Route exact path= '/header' component={Create}/>
                    <Route path='/edit/:id' component={Edit}/>
                    <Route path='/index' component={Home}/>
                    <Route path='/add' component={Add}/>
                </Switch>
            </div> 
                {/* container */}
        </Router>
    );
  }
}
export default App;
